				if err != nil {
					common.CBLog.Error(err)
					return err
				}
				defer res.Body.Close()
				body, err := ioutil.ReadAll(res.Body)
				if err != nil {
					common.CBLog.Error(err)
					return err
				}

				fmt.Println("HTTP Status code: " + strconv.Itoa(res.StatusCode))
